import React from 'react'
import { InputGroup,FormCheck } from 'react-bootstrap';

export default class CheckBox extends React.Component {

    render() {
        return (
            <div>
                
                <InputGroup>
                    <label>{this.props.number}</label>
                    <FormCheck/>
                    <label>{this.props.label}</label>
                </InputGroup>
                
            </div>
        )
    }
}

